CheckCollisions endp

UpdateAnimations proc
    LOCAL deltaT:REAL4
    LOCAL maxFrames:DWORD
    LOCAL boneIdx:DWORD
    LOCAL frameBlend:REAL4
    
    fild deltaTime
    fld const_one
    fld const_one
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fdiv
    fstp deltaT
    
    ; Get max frames for current animation (baseado no vÃ­deo do YouTube)
    mov eax, plr.animState
    .IF eax == ANIM_IDLE
        mov maxFrames, 16
    .ELSEIF eax == ANIM_WALK
        mov maxFrames, 24
    .ELSEIF eax == ANIM_RUN
        mov maxFrames, 12
    .ELSEIF eax == ANIM_JUMP
        mov maxFrames, 8
    .ELSEIF eax == ANIM_SPIN_DASH
        mov maxFrames, 6
    .ELSEIF eax == ANIM_BOOST
        mov maxFrames, 10
    .ELSEIF eax == ANIM_HOMING_ATTACK
        mov maxFrames, 8
    .ELSEIF eax == ANIM_GRIND
        mov maxFrames, 8
    .ELSEIF eax == ANIM_WALL_RUN
        mov maxFrames, 10
    .ELSEIF eax == ANIM_TRICK
        mov maxFrames, 12
    .ELSEIF eax == ANIM_DRIFT
        mov maxFrames, 8
    .ELSEIF eax == ANIM_DROP_DASH
        mov maxFrames, 6
    .ELSEIF eax == ANIM_STOMP
        mov maxFrames, 6
    .ELSEIF eax == ANIM_HURT
        mov maxFrames, 4
    .ELSEIF eax == ANIM_SUPER
        mov maxFrames, 20
    .ELSE
        mov maxFrames, 8
    .ENDIF
    
    ; Update frame
    fld plr.animFrame
    fld deltaT
    fld plr.animSpeed
    fmul
    fadd
    fstp plr.animFrame
    
    ; Calculate blend factor
    fld plr.animFrame
    fist temp_int
    fisub temp_int
    fstp frameBlend
    
    ; Loop animation
    fld plr.animFrame
    fild maxFrames
    fcomip st(0), st(1)
    fstp st(0)
    jb anim_ok
    
    fldz
    fstp plr.animFrame
    
anim_ok:
    ; Atualizar bones com base na animaÃ§Ã£o atual
    ; Sistema de skeletal animation inspirado no vÃ­deo
    invoke UpdateSkeletalAnimation, plr.animState, plr.animFrame, frameBlend
    
    ret
UpdateAnimations endp

UpdateSkeletalAnimation proc uses ebx esi edi, animState:DWORD, frame:REAL4, blend:REAL4
    LOCAL boneIdx:DWORD
    LOCAL angle:REAL4
    
    mov boneIdx, 0
    
update_bone_loop:
    mov eax, boneIdx
    cmp eax, 69
    jge update_bones_done
    
    ; Calcular rotaÃ§Ã£o baseada no estado de animaÃ§Ã£o
    mov ebx, animState
    
    .IF ebx == ANIM_WALK
        ; Animar pernas alternadamente
        mov eax, boneIdx
        ; Bone 117: Right Leg
        cmp eax, 117
        je animate_right_leg
        ; Bone 122: Left Leg
        cmp eax, 122
        je animate_left_leg
        jmp next_bone
        
animate_right_leg:
        fld frame
        fld TWO_PI
        fmul
        fsin
        fstp angle
        ; Aplicar rotaÃ§Ã£o ao bone
        invoke ApplyBoneRotation, 117, angle, const_zero, const_zero
        jmp next_bone
        
animate_left_leg:
        fld frame
        fld TWO_PI
        fmul
        fld PI
        fadd
        fsin
        fstp angle
        invoke ApplyBoneRotation, 122, angle, const_zero, const_zero
        jmp next_bone
        
    .ELSEIF ebx == ANIM_RUN
        ; AnimaÃ§Ã£o de corrida mais rÃ¡pida
        mov eax, boneIdx
        cmp eax, 117
        je animate_run_right
        cmp eax, 122
        je animate_run_left
        ; BraÃ§os tambÃ©m se movem
        cmp eax, 111  ; Right Arm
        je animate_right_arm
        cmp eax, 105  ; Left Arm
        je animate_left_arm
        jmp next_bone
        
animate_run_right:
        fld frame
        fld TWO_PI
        fld const_one
        fld const_one
        fadd
        fmul
        fmul
        fsin
        fstp angle
        invoke ApplyBoneRotation, 117, angle, const_zero, const_zero
        jmp next_bone
        
animate_run_left:
        fld frame
        fld TWO_PI
        fld const_one
        fld const_one
        fadd
        fmul
        fmul
        fld PI
        fadd
        fsin
        fstp angle
        invoke ApplyBoneRotation, 122, angle, const_zero, const_zero
        jmp next_bone
        
animate_right_arm:
        fld frame
        fld TWO_PI
        fmul
        fld PI
        fadd
        fsin
        fstp angle
        invoke ApplyBoneRotation, 111, angle, const_zero, const_zero
        jmp next_bone
        
animate_left_arm:
        fld frame
        fld TWO_PI
        fmul
        fsin
        fstp angle
        invoke ApplyBoneRotation, 105, angle, const_zero, const_zero
        jmp next_bone
        
    .ELSEIF ebx == ANIM_SPIN_DASH
        ; RotaÃ§Ã£o completa do corpo
        fld frame
        fld TWO_PI
        fld const_one
        fld const_one
        fadd
        fadd
        fadd
        fmul
        fmul
        fstp angle
        invoke ApplyBoneRotation, 96, const_zero, angle, const_zero  ; Hips
        jmp next_bone
        
    .ELSEIF ebx == ANIM_SUPER
        ; AnimaÃ§Ã£o especial Super Sonic
        fld frame
        fld TWO_PI
        fmul
        fsin
        fstp angle
        invoke ApplyBoneRotation, 98, const_zero, const_zero, angle  ; Head
        
    .ENDIF
    
next_bone:
    inc boneIdx
    jmp update_bone_loop
    
update_bones_done:
    ret
UpdateSkeletalAnimation endp

ApplyBoneRotation proc uses ebx esi, boneId:DWORD, angleX:REAL4, angleY:REAL4, angleZ:REAL4
    ; Aplicar rotaÃ§Ã£o Euler ao bone especificado
    ; (simplificado - em produÃ§Ã£o usaria quaternions)
    mov eax, boneId
    imul eax, 64
    lea esi, [bone_matrices + eax]
    
    ; Atualizar matriz de rotaÃ§Ã£o
    ; [0,0] = cos(angleY) * cos(angleZ)
    fld angleY
    fcos
    fld angleZ
    fcos
    fmul
    fstp REAL4 PTR [esi]
    
    ; Outras entradas da matriz...
    ; (implementaÃ§Ã£o completa necessÃ¡ria)
    
    ret
ApplyBoneRotation endp

CreateRingParticles proc x:REAL4, y:REAL4, z:REAL4
    LOCAL i:DWORD
    mov i, 0
    
create_particles_loop:
    cmp i, 10
    jge create_particles_done
    cmp particleCount, MAX_PARTICLES
    jge create_particles_done
    
    mov eax, particleCount
    mov ebx, SIZEOF particle
    mul ebx
    lea esi, [particles + eax]
    
    fld x
    fstp REAL4 PTR [esi + particle.x]
    fld y
    fstp REAL4 PTR [esi + particle.y]
    fld z
    fstp REAL4 PTR [esi + particle.z]
    
    ; Random velocity
    invoke GetTickCount
    and eax, 0FFh
    mov temp_int, eax
    fild temp_int
    fld const_one
    fld const_one
    fadd
    fadd
    fadd
    fadd
    fdiv
    fstp REAL4 PTR [esi + particle.vx]
    
    fld const_one
    fld const_one
    fadd
    fstp REAL4 PTR [esi + particle.vy]
    
    fldz
    fstp REAL4 PTR [esi + particle.vz]
    
    mov dword ptr [esi + particle.life], 30
    mov dword ptr [esi + particle.maxLife], 30
    mov byte ptr [esi + particle.r], 255
    mov byte ptr [esi + particle.g], 215
    mov byte ptr [esi + particle.b], 0
    
    inc particleCount
    inc i
    jmp create_particles_loop
    
create_particles_done:
    ret
CreateRingParticles endp

